import React, { Component} from 'react';
import $ from 'jquery';
import data from "../data"; 
class home extends Component{
    componentDidMount() {
        $(document).ready(function() {
            $( ".card" ).hover(
                function() {
                    $(this).addClass('shadow-lg').css('cursor', 'pointer'); 
                }, function() {
                    $(this).removeClass('shadow-lg');
                }
            );
        });
    }
    
    render(){
    
		return (
			<main role="main">
			<div className="container">
			 <h3>APIs & Services</h3>
			 <p>Access information on how to use Forget APIs and Services</p>
			 <div className="row row equal mb-4" >
			 {
				data.ApiList.map((applist, i) => {
					return (
					 <div key={i}className="col-sm-4">
					<div key={i}class="card">
					<div key={i}class="card-body card h-100 ">
					<h5 key={i}class="card-title">{applist.title}</h5>
					<p key={i} class="card-text">{applist.descriptions}</p>
					
					<div class="card-footer">
					<ul class="list-unstyled mt-3 mb-4">
						<li><a key={i} href={applist.link}>Intro</a></li>
						  <li><a key={i} href={applist.link}>Intro</a></li>
						  <li>
					<a key={i} href={applist.link}>Developer's guide </a></li>
					</ul>
					
					</div>
					
					
					</div>
					</div>
					</div>
					);
				})
			 }
			 </div>
			</div>
			</main>
		);
    }
}
export default home;
